&quot;Part of Your World&quot; is a song written by composer Alan Menken and lyricist Howard Ashman for Walt Disney Picture's twenty-eighth animated feature film The Little Mermaid . Originally recorded by American actress and singer Jodi Benson in her film role as Ariel, &quot;Part of Your World&quot; is a Broadway-style ballad in which the film's heroine, a mermaid, expresses her desire to become human.&quot;Part of Your World&quot; Remake features carly rae jepson with the official soundtrack for the movie.

